import { Splide, SplideSlide } from "@splidejs/react-splide";
import React, { Component } from "react";
import kep1 from "../img/album/20200204_113822.jpg";
import kep2 from "../img/album/20200204_113950.jpg";
import kep3 from "../img/album/20200204_114059.jpg";
import { Carousel } from "react-bootstrap";

class SplideComponent extends Component {
  constructor(props) {
    super(props);
    this.primaryRef = React.createRef();
    this.secondaryRef = React.createRef();
  }

  render() {
    return (
      <div>
        <Carousel interval={2000}>
          <Carousel.Item>
            <img src={kep1} height="250px" width="100%" alt="img1" />
          </Carousel.Item>
          <Carousel.Item>
            <img src={kep2} height="250px" width="100%" alt="img1" />
          </Carousel.Item>
          <Carousel.Item>
            <img src={kep3} height="266px" width="100%" alt="img1" />
          </Carousel.Item>
        </Carousel>

        <div id="secondary-slider" className="splide">
          <div className="splide__track">
            <ul className="splide__list">
              <li className="splide__slide">
                <img src={kep1} />
              </li>
              <li className="splide__slide">
                <img src={kep2} />
              </li>
              <li className="splide__slide">
                <img src={kep3} />
              </li>
            </ul>
          </div>
        </div>
      </div>
    );
  }
}

export default SplideComponent;
